import React from 'react';

const AddCategoryButton = () => {
  return (
    <button
      className="flex w-[135px] h-[41px] p-4 justify-center items-center gap-4 flex-shrink-0 rounded-lg bg-[#0A3B83] text-[#FFF] font-roboto text-[20px] font-semibold"
    >
      Add Category
    </button>
  );
};

export default AddCategoryButton;
